import React, { Component } from "react";

import "./App.css";

class App extends Component {
  state = {
    logoName: ["logo", "Changed"],
    i: 0,
  };

  render() {
    return (
      <div className="App">
        <header>
          <div
            onClick={() => {
              if (this.state.i > 0) {
                this.setState({ i: this.state.i - 1 });
              }
              this.setState({ i: this.state.i + 1 });
            }}
          >
            {this.state.logoName[this.state.i]}
          </div>
          <nav class="nav justify-content-center"></nav>
        </header>
      </div>
    );
  }
}

export default App;
